&lt;b&gt;Producto:&lt;/b&gt; Casquillo Inyección Fischer&lt;br&gt;&lt;br&gt;

El tamiz para FIS H N de fischer es un componente de sistema para el empleo los morteros de inyección FIS V, FIS VL, FIS P Plus, FIS P y FIS Green de fischer en mampostería de piedra perforada sin homologación.&lt;br&gt;&lt;br&gt;

&lt;b&gt;Datos técnicos:&lt;/b&gt;&lt;br&gt;
La estructura de red del casquillo permite la distribución uniforme de resina en el agujero de perforación y por lo tanto para una sujeción segura.&lt;br&gt;
Largo: 85 Mm.&lt;br&gt;
Apto para:&lt;br&gt;
Ladrillo perforado en vertical.&lt;br&gt;
Bloques huecos de hormigón ligero.&lt;br&gt;
Bloques huecos de hormigón.&lt;br&gt;
Ladrillo de piedra arenisca perforado.&lt;br&gt;
Ladrillo macizo de piedra arenisca.&lt;br&gt;
Ladrillo macizo.
Losetas huecas de piedra pómez.&lt;br&gt;
Losas de ladrillo hueco y otro ladrillo perforado.&lt;br&gt;
Piedra pómez maciza y otros materiales de construcción macizos.&lt;br&gt;&lt;br&gt;

&lt;b&gt;Instrucciones de montaje:&lt;/b&gt;&lt;br&gt;

El casquillo se coloca en el agujero de perforación, y se llena con resina en la base del casquillo.&lt;br&gt;
Roscar la varilla donde haya el taco químico donde empujará el producto a través de la estructura de rejilla del casquillo, para que se ajuste el material de base a la perfección.&lt;br&gt;
Las cargas van en función del soporte y la profunidad del anclaje.&lt;br&gt;&lt;br&gt;

